// useFetchProjects.js
import React, { useState, useEffect } from "react";

function useFetchProjects() {
  useEffect(() => {
    const projectsApi =
      "http://127.0.0.1:8090/api/collections/projects/records/";

      fetch(projectsApi)
  }, []);


  return { projectsApi };
}

export default useFetchProjects;
